import React, {Component} from 'react';

class Feed extends Component{
    render() {
        return(
            <section id="content">

                <div className="content-wrap nopadding">

                    <div id="portfolio" className="portfolio grid-container portfolio-3 portfolio-full portfolio-nomargin portfolio-notitle clearfix" >

                        <article className="portfolio-item pf-media pf-icons">
                            <div className="portfolio-image">
                                <a href="portfolio-single.html">
                                    <img src="./src/images/portfolio/4/1.jpg" alt="Open Imagination"></img>
                                </a>
                                <div className="portfolio-overlay">
                                    <a href="./src/images/portfolio/4/1.jpg" className="left-icon" data-lightbox="image"><i className="icon-line-plus"></i></a>
                                    <a href="portfolio-single.html" className="right-icon"><i className="icon-line-ellipsis"></i></a>
                                </div>
                            </div>
                            <div className="portfolio-desc">
                                <h3><a href="portfolio-single.html">Open Imagination</a></h3>
                                <span><a href="#">Media</a>, <a href="#">Icons</a></span>
                            </div>
                        </article>
                    </div>

                </div>

            </section>
        );
    }
}

export default Feed;
